tamins and minerals (the vegetable salad, the zucchini, and the peach), and a glass of water.</p>\\n\\n<p>Lunch D is not very healthy. A hamburger made at home may be healthy, but when it is accompanied by fries, when there are no sources of vitamins, and when soda replaces water, the lunch is considered as junk and unhealthy. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"1aa62283-2708-45ad-a3a4-41a79fac0be2\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Solution\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Solution\"},\"subContentId\":\"14d498d7-1951-46f9-8cfc-7e3440d83884\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Sami&#039;s Diet\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Sami&#039;s Diet\"},\"subContentId\":\"184a86e5-ce7e-4a00-90f2-b7ac65a93f4e\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Problem 2: The Calories</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"1561b38a-c3d8-41a1-91a5-c983bff33b70\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"The calories\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>Sarah is a grade 4 student. Following are the three meals and the snack with the amount of calories each type of food provided that she ate today, . </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"change s between 1,800 and 2,200 calories per day. </p>\\n\\n<p>4. Since Sarah is very active, she is not overeating. She is actually within the range of calories needed for an active girl. </p>\\n\\n<p>5. If Sarah becomes sedentary and continues to follow this diet, she is at risk of gaining a lot of weight and eventually becoming obese. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"5f9efe59-5137-4456-b85e-3f2f14caa19a\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Solution\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Solution\"},\"subContentId\":\"2a96d85e-4274-4140-8787-35c93f0e1742\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation Tool\"},\"subContentId\":\"b59bc45f-c201-494f-b858-2a31c959a4d5\"},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.16","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"I solve complex problems","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.AdvancedText-1.1/text.js?version=1.1.14","/h5p/libraries/H5P.Text-1.1/scripts/text.js?version=1.1.17","/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.TextInputField-1.2/text-input-field.js?version=1.2.13","/h5p/libraries/H5P.TextInputField-1.2/xapi-generator.js?version=1.2.13","/h5p/libraries/H5P.StandardPage-1.5/standard-page.js?version=1.5.15","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version
